import React from 'react'
import {DashContentContaier, CardsContainer, TableContainer, CardWrapper} from '../styles/TableauDeBord.elements'
import Card from '../../../../components/Dashboard.components/Cards/Card'

//cards data
import {CardsData} from '../../../../components/Dashboard.components/Cards/Cards.data'

const TableauDeBord = () => {
  return (
    <>
     <DashContentContaier>
        <CardsContainer>
            {CardsData.map((card, id) => {
              return (
                <CardWrapper key={id}>
                  <Card
                    title={card.title}
                    color={card.color}

                    value={card.value}
                    png={card.png}
                    series={card.series}
                  />
                </CardWrapper>
              );
            })}
        </CardsContainer>
        <TableContainer>
          <h1>content</h1>
       </TableContainer>
     </DashContentContaier>
    </>
  )
}

export default TableauDeBord
